column49:
The primary purpose of the study is to evaluate the current quantity, quality and accessibility of playing pitches and other sports and active recreational provision in the Borough and establish an updated baseline of provision to inform future plan making and investment decisions with regard to:
•	Playing pitches;
•	Indoor sports and active recreation facilities;  
•	Outdoor leisure space for organised sport; and
•	Informal/casual outdoor active recreational opportunities.

The aim of the pilot programme is to:
• amplify the voice of ONS G7/G6 EM colleagues;
• broaden networks and opportunities beyond EM
communities and ONS;
• connect the experiences and thinking of our diverse
communities, line managers and senior leaders, to learn and grow together in this space;
• further explore and address cultural and organisational
issues relating to retention of EM colleagues;
• strengthen a community of support.
